import { Navigate } from "react-router-dom";
import "./BotoesInformacoes.css";

function BotoesInformacoes(props) {
  return (
    <div className="Botoes">
      <button
        onClick={() => {
          Navigate("/");
        }}
      >
        sair
      </button>
      <button
        onClick={() => {
          Navigate("map", { state: { id: props.id } });
        }}
      >
        localizar
      </button>
    </div>
  );
}
export default BotoesInformacoes;
